import React from 'react'
import '../App.css'


class UserProfilePage extends React.Component {
  state = {
    userId: null
  }

  componentDidMount() {
      this.setState({
          userId: this.props.match.params,
      })
  }

  render() {
    return (
      <h1>User Profile Page</h1>
    )
  }
}

export default UserProfilePage
